import styled from "styled-components";

const LoginContainer = styled.div`
  margin: 0 !important;
  justify-content: center;
  background-color: white;
  flex-direction: column;
  height: calc() (var(--mobile-screen) + 40vh);
  font-size: 4rem;
`;

const LoginGNB = styled.h1``;

const StaticInfos = styled.div`
  width: 100%;
  background-color: red;
  margin: 0rem;
  display: flex;
  flex-direction: column;
  padding: 4rem;
`;

const StaticInfo = styled.span``;

const UpdateForm = styled.form``;

const UpdateHeader = styled.h1``;

const UpdateLabel = styled.label``;

const UpdateInput = styled.input``;

const LoginBTN = styled.button``;

function Login() {
  return (
    <div id="GlobalContainer">
      <LoginContainer className="container">
        <LoginGNB className="gnb">로그인</LoginGNB>
        <LoginForm className="form">
          <LoginBTN className="submit_btn" type="submit">
            로그인
          </LoginBTN>
        </LoginForm>
      </LoginContainer>
    </div>
  );
}

export default Login;
